import React, { Component } from "react";
import ServiceList from "./ServiceList";
import homeimage from "../images/home-image.png";
import "bootstrap/dist/css/bootstrap.min.css";
import "./Home.css"; // create this file

export default class Home extends Component {
  render() {
    return (
      <div>
        {/* Main section */}
        <div className="container-fluid pt-5 mt-5">
          <div className="row align-items-center min-vh-100">
            {/* Left side - text */}
            <div className="col-12 col-md-4 text-center text-md-start p-5">
              <h1 className="display-4 fw-bold">Hello</h1>
              <p className="lead">Welcome to Book My Clean</p>
            </div>

            {/* Right side - image */}
            <div className="col-12 col-md-8 p-0">
              <img
                src={homeimage}
                alt="Book My Clean"
                className="img-fluid w-100 h-100 object-fit-cover"
              />
            </div>
          </div>
        </div>

        {/* Services Section */}
        <ServiceList />

        {/* Just for testing scroll */}
        <div className="container border" style={{ height: "1000px" }}></div>
      </div>
    );
  }
}
